import React from 'react'
import InfoTile from './InfoTile'

class HomeContent extends React.Component {
    render() {
        return (
            <InfoTile 
            title="What is Bemani Score Tracker?"
            imageSource="https://upload.wikimedia.org/wikipedia/en/thumb/e/e0/WPVG_icon_2016.svg/1024px-WPVG_icon_2016.svg.png"
            description={[<strong>Bemani Score Tracker</strong>, " is a system created for rhythm gamers to neatly organize their scores, play, and progress over their playtime. With various features to help manage scores and create / accomplish goals. This site will always be evolving, so don't hesitate to check the", <a href="#">Changelog</a>, " for the latest updates!"
              ]}
            />
        )
    }
}

export default HomeContent;
